CREATE TABLE k_Institution (
    IDINS integer,
    lodINS character varying(255) NOT NULL,
    INS character varying(255),
    labelInstitution character varying(255),
    descInstitution text,
    lodINS_V character varying(255),
    Country text,
    populatedBy character varying(255),
    lastTouch character varying(255),
    alternateIdentifier character varying(255),
    homeURL character varying(255),
    PRIMARY KEY (lodINS)
);





